import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import Hook from './Hook';
import MapMethod from './MapMethod'
import Obj from './component/Obj'



ReactDOM.render(

   <>


    { Obj.map(( curVal) => {
        return(
          <MapMethod
       id = {curVal.id}
       name = {curVal.name}
       subject = {curVal.subject}
     />
        )
    })}
   </>,
  document.getElementById('root')
);
